const Spacial = ()=>{
return(
    <div className="spacial">
        <div className="contianer">
            <div className="row">
                <div className="col">
                    <div className='heading h1 text-dark pt-4'>Spacial</div>
                </div>
            </div>
        </div>
    </div>
)
}

export default Spacial;
